import React, { Component } from 'react';
import Bowl from './Ingredients/Bowl';
import Ingredients from './Ingredients/Ingredients';
import classes from './TestUI.module.css';
class TestUI extends Component {
    render() {
        return (
            <div>
             <div className={classes.TestUI.square}></div>
                    <div class={classes.TestUI.child}><Bowl />
                   <Ingredients imgName='lettuceBGfree.png' />
                   <Ingredients imgName='quinoaBgfree.png' /></div>
                </div>
        );
    };
}

export default TestUI;
